    [],nt"revision_timestamp": "2013-03-15T11:30:46.413397",nt"name": "spatial-vegetation-data-for-voyageurs-national-park-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "The vegetation spatial database coverage
    is of Voyageurs National Park and extended environs, covering 156,886 hectares (387,674
    acres). Voyageurs National Park comprises 88,244 hectares (218,055 acres) of the
    total coverage area (56%). Almost 33,000 polygons make up the coverage, each with
    map unit description and physiognomic attribute information. The database provides
    crosswalk information to all USNVC floristic and physiognomic levels and several
    other classification systems (ecological groups/subgroups, Minnesota communities,
    NW Ontario forest and wetland ecosystems, USGS land use/land cover). A total of
    50 USNVC associations make up the vegetation at Voyageurs National Park and environs.
    With all vegetation types, land use classes, and park specific categories combined,
    a total of 67 map units define the ground features within the project area. Applicable
    physiognomic modifiers define each vegetation map unit in more detail about the
    vegetation structure within a polygon (density, pattern, height, dominance). The
    spatial database was produced from the interpretation of fall 1995 and 1996 1:15,840-scale
    color infrared (CIR) aerial photographs. The interpreted data were transferred and
    automated using base maps produced from USGS digital orthophoto quadrangles (DOQ's)
    or using Ontario Basic Mapping Series (OBM) topographic maps. About 92% of the spatial
    coverage is produced using the DOQ-based maps. The finished spatial database is
    a single seamless coverage. The estimated overall thematic accuracy for vegetation
    map units is 82.4%.",nt"license_title": null,nt"extras": [{ntt"key":
